import React, { useState, useEffect } from 'react';

function GuestPage() {
    const [screeningIds, setScreeningIds] = useState([]);

    useEffect(() => {
        fetch('http://localhost:8080/screenings/allScreenings')
            .then(response => response.json())
            .then(data => {
                const ids = data.map(screening => screening.id); // Extracting only the IDs
                setScreeningIds(ids);
            })
            .catch(error => console.error(error));
    }, []);

    return (
        <div>
            <h1>Welcome as Guest</h1>
            <h2>Screening IDs:</h2>
            <ul>
                {screeningIds.map(id => (
                    <li key={id}>{id}</li>
                ))}
            </ul>
        </div>
    );
}

export default GuestPage;
